import logo from './logo.svg';
import './App.css';
import './HomePage.js';
import './AboutUs';
import HomePage from './HomePage.js';
import AboutUs from './AboutUs.js';
import { BrowserRouter,Route,RedirectFunction } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Route exact path='/' component={HomePage}/>
        <Route path='/' component={AboutUs}/>
        <RedirectFunction to='/'/>
      </BrowserRouter>
      <HomePage/>
    </div>
  );
}

export default App;
